// src/pages/Projects/Projects.js
import React, { useEffect, useState } from 'react';
import { useLocation } from 'react-router-dom';
import { Box, Typography, Grid, Card, CardContent, Button, Chip, TextField } from '@mui/material';
import { motion } from 'framer-motion';
import './Projects.css';

export default function Projects() {
  const [projects, setProjects] = useState([]);
  const [filtered, setFiltered] = useState([]);
  const [filterOwner, setFilterOwner] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');
  const location = useLocation();

  // Read optional ?user=maria or ?user=yazan
  const queryParams = new URLSearchParams(location.search);
  const selectedUser = queryParams.get('user');

  // Fetch once
  useEffect(() => {
    fetch('http://localhost:5000/api/portfolio/projects')
      .then(res => res.json())
      .then(data => setProjects(data))
      .catch(err => console.error(err));
  }, []);

  // Re-filter whenever data or filters change
  useEffect(() => {
    let data = [...projects];

    if (selectedUser) {
      data = data.filter(p => p.owner === selectedUser);
      setFilterOwner(selectedUser);
    } else if (filterOwner) {
      data = data.filter(p => p.owner === filterOwner);
    }

    if (searchTerm) {
      const term = searchTerm.toLowerCase();
      data = data.filter(p => p.title.toLowerCase().includes(term));
    }

    setFiltered(data);
  }, [projects, selectedUser, filterOwner, searchTerm]);

  return (
    <Box className="projects-container">
      <Typography variant="h3" align="center" gutterBottom className="projects-title">
        Projects
      </Typography>

      <Box className="projects-filters">
        <Chip
          label="All"
          clickable
          color={!filterOwner ? 'primary' : 'default'}
          onClick={() => setFilterOwner(null)}
        />
        <Chip
          label="Maria"
          clickable
          color={filterOwner === 'maria' ? 'primary' : 'default'}
          onClick={() => setFilterOwner('maria')}
        />
        <Chip
          label="Yazan"
          clickable
          color={filterOwner === 'yazan' ? 'primary' : 'default'}
          onClick={() => setFilterOwner('yazan')}
        />
        <TextField
          placeholder="Search by title..."
          variant="outlined"
          size="small"
          className="search-input"
          value={searchTerm}
          onChange={e => setSearchTerm(e.target.value)}
        />
      </Box>

      {filtered.length === 0 ? (
        <Typography variant="body1" align="center" className="no-projects">
          No projects found{filterOwner ? ` for ${filterOwner}` : ''}.
        </Typography>
      ) : (
        <Grid container spacing={4}>
          {filtered.map(p => (
            <Grid item xs={12} sm={6} md={4} key={p.id}>
              <motion.div
                whileHover={{ scale: 1.03 }}
                whileTap={{ scale: 0.97 }}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5 }}
              >
                <Card className="project-card">
                  <CardContent>
                    <Typography variant="h5" gutterBottom>
                      {p.title}
                    </Typography>
                    <Typography variant="subtitle2" className="project-owner">
                      {p.owner.charAt(0).toUpperCase() + p.owner.slice(1)}
                    </Typography>
                    <Typography variant="body2" paragraph>
                      {p.description}
                    </Typography>
                    {p.link && (
                      <Button
                        variant="outlined"
                        className="project-button"
                        href={p.link}
                        target="_blank"
                        rel="noreferrer"
                      >
                        View Project
                      </Button>
                    )}
                  </CardContent>
                </Card>
              </motion.div>
            </Grid>
          ))}
        </Grid>
      )}
    </Box>
);
}
